import React, { useState, useContext } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { AuthContext } from '../contexts/AuthContext';

const Register = () => {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [passwordConfirm, setPasswordConfirm] = useState('');
  const [phone, setPhone] = useState('');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  const { register, authError } = useContext(AuthContext);
  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');

    // Şifrelerin eşleştiğini kontrol et
    if (password !== passwordConfirm) {
      return setError('Şifreler eşleşmiyor');
    }

    // Şifre uzunluğunu kontrol et
    if (password.length < 6) {
      return setError('Şifre en az 6 karakter olmalıdır');
    }

    setLoading(true);

    try {
      await register(name, email, password, phone);
      navigate('/dashboard');
    } catch (err) {
      setError(err.message || 'Kayıt sırasında bir hata oluştu');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="max-w-md mx-auto">
      <h1 className="text-2xl font-bold text-center mb-6">Kayıt Ol</h1>

      {(error || authError) && (
        <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded mb-4">
          {error || authError}
        </div>
      )}

      <form onSubmit={handleSubmit} className="card">
        <div className="mb-4">
          <label htmlFor="name" className="form-label">Adınız Soyadınız</label>
          <input
            type="text"
            id="name"
            value={name}
            onChange={(e) => setName(e.target.value)}
            required
            className="input-field"
          />
        </div>

        <div className="mb-4">
          <label htmlFor="email" className="form-label">E-posta Adresi</label>
          <input
            type="email"
            id="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
            className="input-field"
          />
        </div>

        <div className="mb-4">
          <label htmlFor="phone" className="form-label">Telefon Numarası (İsteğe Bağlı)</label>
          <input
            type="tel"
            id="phone"
            value={phone}
            onChange={(e) => setPhone(e.target.value)}
            className="input-field"
          />
        </div>

        <div className="mb-4">
          <label htmlFor="password" className="form-label">Şifre</label>
          <input
            type="password"
            id="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            required
            className="input-field"
          />
        </div>

        <div className="mb-6">
          <label htmlFor="passwordConfirm" className="form-label">Şifre Tekrarı</label>
          <input
            type="password"
            id="passwordConfirm"
            value={passwordConfirm}
            onChange={(e) => setPasswordConfirm(e.target.value)}
            required
            className="input-field"
          />
        </div>

        <button
          type="submit"
          disabled={loading}
          className="btn-primary w-full"
        >
          {loading ? 'Kaydediliyor...' : 'Kayıt Ol'}
        </button>

        <p className="mt-4 text-center text-gray-600">
          Zaten hesabınız var mı?{' '}
          <Link to="/login" className="text-primary-600 hover:underline">
            Giriş Yap
          </Link>
        </p>
      </form>
    </div>
  );
};

export default Register;
